ARR_By_Month.query:
q = load "${App.Datasets.subscription_tp.FullyQualifiedName}";
start = group q by ('SBQQ_Contract_c_StartDate_Year', 'SBQQ_Contract_c_StartDate_Month');
start = foreach start generate 'SBQQ_Contract_c_StartDate_Year', 'SBQQ_Contract_c_StartDate_Month', sum('ARR') as 'sum_ARR';
enddate = group q by ('SBQQ_Contract_c_EndDate_Year', 'SBQQ_Contract_c_EndDate_Month');
enddate = foreach enddate generate 'SBQQ_Contract_c_EndDate_Year' as 'SBQQ_Contract_c_StartDate_Year', 'SBQQ_Contract_c_EndDate_Month' as 'SBQQ_Contract_c_StartDate_Month', sum('ARR') as 'sum_ARR';
final = group start by ('SBQQ_Contract_c_StartDate_Year','SBQQ_Contract_c_StartDate_Month') full, enddate by ('SBQQ_Contract_c_StartDate_Year','SBQQ_Contract_c_StartDate_Month');
final = foreach final generate coalesce (start['SBQQ_Contract_c_StartDate_Year'],enddate['SBQQ_Contract_c_StartDate_Year']) as 'SBQQ_Contract_c_StartDate_Year', coalesce (start['SBQQ_Contract_c_StartDate_Month'],enddate['SBQQ_Contract_c_StartDate_Month']) as 'SBQQ_Contract_c_StartDate_Month',coalesce(sum(start['sum_ARR']),0) - coalesce(sum(enddate['sum_ARR']),0) as 'sum_ARR';

final = fill final by (dateCols=('SBQQ_Contract_c_StartDate_Year','SBQQ_Contract_c_StartDate_Month', "Y-M"));

final = group final by ('SBQQ_Contract_c_StartDate_Year','SBQQ_Contract_c_StartDate_Month');
final = foreach final generate 'SBQQ_Contract_c_StartDate_Year' +"~~~"+ 'SBQQ_Contract_c_StartDate_Month' as 'SBQQ_Contract_c_StartDate_Year~~~SBQQ_Contract_c_StartDate_Month', sum(sum('sum_ARR')) over ([..0] partition by all order by ('SBQQ_Contract_c_StartDate_Year','SBQQ_Contract_c_StartDate_Month')) as 'sum_ARR';

final = order final by 'SBQQ_Contract_c_StartDate_Year~~~SBQQ_Contract_c_StartDate_Month' asc

